export default {
  name: 'sortchild',
  props: ['fruit'],
  computed: {
    pages: function pages() {
      var _this = this;

      var pages = [];
      Object.keys(this.fruit).forEach(function (item, index) {
        var page = Math.floor(index / 3); //3代表3条为一行，随意更改

        if (!pages[page]) {
          pages[page] = [];
        }

        pages[page].push(_this.fruit[item]);
      });
      return pages;
    }
  }
};
